    class Mhwi(CC):
        def __init__(self, filepath: str) -> None:
            super().__init__(filepath)

        async def decrypt_region(self, offset: int, length: int) -> None:
            await self.r_stream.seek(offset + length)
            msg = await self.r_stream.read(0x200)
            key_salt = self.zlib.crc32(msg, 0xC0490023 ^ 0xFF_FF_FF_FF) ^ 0xFF_FF_FF_FF
            save_offset = offset

            salt = self.generate_salt(key_salt)
            keys = self.generate_keys(key_salt, salt)
            key_length = self.generate_key_length(key_salt, length)

            bl = self.AES.block_size
            await self.r_stream.seek(offset)
            r_len = min(self.CHUNKSIZE, length)
            r_len &= ~(bl - 1)
            chunk = bytearray(await self.r_stream.read(r_len))
            chunksize = len(chunk)
            chunk_off = offset
            pos = 0

            for i in range(32):
                salt_offset = 0
                cipher = self.AES.new(keys[i], self.AES.MODE_ECB)

                while save_offset < key_length[i] + offset:
                    # Get salt values as 32-bit DWORDs - MASK EACH INDEX
                    salt_idx_0 = (salt_offset + 0) & 0x7F
                    salt_idx_1 = (salt_offset + 1) & 0x7F
                    salt_idx_2 = (salt_offset + 2) & 0x7F
                    salt_idx_3 = (salt_offset + 3) & 0x7F

                    salt_val_0 = struct.unpack("<I", salt[salt_idx_0 * 4:salt_idx_0 * 4 + 4])[0]
                    salt_val_1 = struct.unpack("<I", salt[salt_idx_1 * 4:salt_idx_1 * 4 + 4])[0]
                    salt_val_2 = struct.unpack("<I", salt[salt_idx_2 * 4:salt_idx_2 * 4 + 4])[0]
                    salt_val_3 = struct.unpack("<I", salt[salt_idx_3 * 4:salt_idx_3 * 4 + 4])[0]

                    # Read current block as DWORDs
                    if pos + bl <= chunksize:
                        block = chunk[pos:pos + bl]
                    else:
                        await self.ext_write(chunk_off, chunk)
                        chunk_off = await self.r_stream.seek(chunk_off + chunksize)
                        r_len = min(self.CHUNKSIZE, length - chunksize)
                        r_len &= ~(bl - 1)
                        chunk = bytearray(await self.r_stream.read(r_len))
                        chunksize = len(chunk)
                        pos = 0
                        block = chunk[:bl]
                    blocksize = len(block)
                    if blocksize != bl:
                        raise CryptoError("Invalid save!")
                    dwords = list(struct.unpack("<4I", block))

                    # Determine branch
                    branch = 4 if (salt_val_0 & 1) == 0 else 0

                    # Pre-decryption XOR
                    if branch == 4: # (salt_val_0 & 1) == 0
                        dwords[0] ^= salt_val_2 # uVar9
                        dwords[2] ^= salt_val_3
                    else: # (salt_val_0 & 1) == 1
                        dwords[1] ^= salt_val_2
                        dwords[3] ^= salt_val_3

                    # Pack and decrypt
                    block = bytearray(struct.pack("<4I", *dwords))
                    cipher.decrypt(block, block)
                    dwords = list(struct.unpack("<4I", block))

                    # Post-decryption XOR
                    if branch == 4:
                        dwords[1] ^= salt_val_0 # uVar4
                        dwords[3] ^= salt_val_1
                    else:
                        dwords[0] ^= salt_val_0
                        dwords[2] ^= salt_val_1

                    # Write back
                    chunk[pos:pos + bl] = struct.pack("<4I", *dwords)

                    salt_offset += 1  # Increment by 1 DWORD
                    save_offset += bl
                    pos += bl
            await self.ext_write(chunk_off, chunk)

        async def encrypt_region(self, offset: int, length: int, saveslot: int) -> None:
            # Generate checksum from UNENCRYPTED data
            checksum = await self.generate_checksum(offset, length, saveslot)

            # Write checksum to the end of the region
            await self.ext_write(offset + length, checksum)

            # Generate encryption key from the checksum
            key_salt = self.zlib.crc32(checksum, 0xC0490023 ^ 0xFF_FF_FF_FF) ^ 0xFF_FF_FF_FF

            save_offset = offset
            salt = self.generate_salt(key_salt)
            keys = self.generate_keys(key_salt, salt)
            key_length = self.generate_key_length(key_salt, length)

            bl = self.AES.block_size
            await self.r_stream.seek(offset)
            r_len = min(self.CHUNKSIZE, length)
            r_len &= ~(bl - 1)
            chunk = bytearray(await self.r_stream.read(r_len))
            chunksize = len(chunk)
            chunk_off = offset
            pos = 0

            # Encrypt in 32 rounds
            for i in range(32):
                salt_offset = 0
                cipher = self.AES.new(keys[i], self.AES.MODE_ECB)

                while save_offset < key_length[i] + offset:
                    # Get salt values as 32-bit DWORDs - MASK EACH INDEX (same as decrypt)
                    salt_idx_0 = (salt_offset + 0) & 0x7F
                    salt_idx_1 = (salt_offset + 1) & 0x7F
                    salt_idx_2 = (salt_offset + 2) & 0x7F
                    salt_idx_3 = (salt_offset + 3) & 0x7F

                    salt_val_0 = struct.unpack("<I", salt[salt_idx_0 * 4:salt_idx_0 * 4 + 4])[0]
                    salt_val_1 = struct.unpack("<I", salt[salt_idx_1 * 4:salt_idx_1 * 4 + 4])[0]
                    salt_val_2 = struct.unpack("<I", salt[salt_idx_2 * 4:salt_idx_2 * 4 + 4])[0]
                    salt_val_3 = struct.unpack("<I", salt[salt_idx_3 * 4:salt_idx_3 * 4 + 4])[0]

                    # Read current block as DWORDs
                    if pos + bl <= chunksize:
                        block = chunk[pos:pos + bl]
                    else:
                        await self.ext_write(chunk_off, chunk)
                        chunk_off = await self.r_stream.seek(chunk_off + chunksize)
                        r_len = min(self.CHUNKSIZE, length - chunksize)
                        r_len &= ~(bl - 1)
                        chunk = bytearray(await self.r_stream.read(r_len))
                        chunksize = len(chunk)
                        pos = 0
                        block = chunk[:bl]
                    blocksize = len(block)
                    if blocksize != bl:
                        raise CryptoError("Invalid save!")
                    dwords = list(struct.unpack("<4I", block))

                    # Determine branch (same as decrypt)
                    branch = 4 if (salt_val_0 & 1) == 0 else 0

                    # Pre-encryption XOR (OPPOSITE of post-decryption XOR)
                    if branch == 4: # (salt_val_0 & 1) == 0
                        dwords[1] ^= salt_val_0
                        dwords[3] ^= salt_val_1
                    else: # (salt_val_0 & 1) == 1
                        dwords[0] ^= salt_val_0
                        dwords[2] ^= salt_val_1

                    # Pack and encrypt
                    block = bytearray(struct.pack("<4I", *dwords))
                    cipher.encrypt(block, block)
                    dwords = list(struct.unpack("<4I", block))

                    # Post-encryption XOR (OPPOSITE of pre-decryption XOR)
                    if branch == 4:
                        dwords[0] ^= salt_val_2
                        dwords[2] ^= salt_val_3
                    else:
                        dwords[1] ^= salt_val_2
                        dwords[3] ^= salt_val_3

                    # Write back
                    chunk[pos:pos + bl] = struct.pack("<4I", *dwords)

                    salt_offset += 1  # Increment by 1 DWORD (same as decrypt)
                    save_offset += bl
                    pos += bl
            await self.ext_write(chunk_off, chunk)

        async def generate_checksum(self, offset: int, length: int, saveslot: int) -> bytes:
            param_1_offset = 0xC0490023

            # Initialize auStack_68 array
            auStack_68 = [
                0x67308D52,
                0x26AE9DAB,
                0x701D5D68,
                param_1_offset
            ]

            # Initialize auStack_58 array using param_5
            auStack_58 = [0] * 8
            auStack_58[0] = 0x394E4E79 ^ auStack_68[saveslot & 3]
            auStack_58[4] = auStack_68[saveslot & 3] ^ 0x137E601C
            auStack_58[1] = 0x681BA6CF ^ auStack_68[(saveslot + 1) & 3]
            auStack_58[5] = auStack_68[(saveslot + 1) & 3] ^ 0x4BF0CF23
            auStack_58[7] = auStack_68[(saveslot - 1) & 3] ^ 0x5D9E0742
            auStack_58[3] = auStack_68[(saveslot - 1) & 3] ^ 0x4BF0CF23
            auStack_58[2] = 0x671A5459 ^ auStack_68[(saveslot + 2) & 3]
            auStack_58[6] = auStack_68[(saveslot + 2) & 3] ^ 0x7C8B3AF0

            # Calculate positions using float arrays
            uVar8 = length >> 3
            fVar15 = float(uVar8)

            auStack_84 = [0] * 7

            for i in range(7):
                idx = i + 1
                if idx < 8:
                    s_val = auStack_58[idx]
                    s_box_val = Crypt_Mhwi.BLOWFISH_SBOX[s_val & 0xFFF]
                    combined = (s_val + s_box_val) & 0xFFF
                    float_val = Crypt_Mhwi.FLOATS[combined]
                    auStack_84[i] = int((float_val - 0.5) * fVar15) + uVar8 * (idx + 1)

            # Set last position
            auStack_84[6] = length

            # Compute CRC values for each segment
            auStack_a8 = [0] * 8

            # First segment
            uStack_88 = int((Crypt_Mhwi.FLOATS[(Crypt_Mhwi.BLOWFISH_SBOX[auStack_58[0] & 0xFFF] +
                        auStack_58[0]) & 0xFFF] - 0.5) * fVar15) + uVar8

            crc32 = self.create_ctx_crc32(uint32(auStack_58[0] ^ 0xFF_FF_FF_FF, "little", const=True))
            await self.checksum(crc32, offset, offset + uStack_88)
            # get crc32 digest
            auStack_a8[0] = self._get_ctx(crc32).attr.value ^ 0xFF_FF_FF_FF

            # Remaining segments
            prev_pos = uStack_88
            for i in range(1, 8):
                cur_pos = auStack_84[i - 1] if i < 7 else length
                init_crc = auStack_a8[i - 1] ^ auStack_58[i]
                crc32 = self.create_ctx_crc32(uint32(init_crc ^ 0xFF_FF_FF_FF, "little", const=True))
                await self.checksum(crc32, offset + prev_pos, offset + cur_pos)
                # get crc32 digest
                auStack_a8[i] = self._get_ctx(crc32).attr.value ^ 0xFF_FF_FF_FF
                prev_pos = cur_pos

            # Combine results
            auStack_c8 = [0] * 4
            for i in range(4):
                auStack_c8[i] = (auStack_a8[i] ^ auStack_58[i] ^
                                 auStack_68[3] ^ auStack_a8[7])

            uStack_b8 = auStack_58[4] ^ auStack_a8[7] ^ auStack_a8[4] ^ auStack_68[3]
            uStack_b4 = auStack_58[5] ^ auStack_a8[7] ^ auStack_a8[5] ^ auStack_68[3]
            uStack_b0 = auStack_a8[6] ^ auStack_68[3] ^ auStack_58[6] ^ auStack_a8[7]
            uStack_ac = auStack_a8[7] ^ auStack_68[3] ^ auStack_58[7]

            # Compute final CRC over all intermediate values
            uVar8 = auStack_68[3] ^ auStack_68[saveslot]

            # Process auStack_58 values
            for val in auStack_58:
                for byte_idx in range(4):
                    byte_val = (val >> (byte_idx * 8)) & 0xFF
                    uVar8 = (uVar8 >> 8) ^ Crypt_Mhwi.CRC_TABLE[byte_val ^ (uVar8 & 0xFF)]

            # Process auStack_a8 values
            for val in auStack_a8:
                val_swapped = self.ES32_int(val)
                for byte_idx in range(4):
                    byte_val = (val_swapped >> ((3 - byte_idx) * 8)) & 0xFF
                    uVar8 = (uVar8 >> 8) ^ Crypt_Mhwi.CRC_TABLE[byte_val ^ (uVar8 & 0xFF)]

            uVar10 = uVar8

            # Generate final 0x200 bytes
            result = bytearray(0x200)
            uVar9 = uVar10

            combined_stack = auStack_c8 + [uStack_b8, uStack_b4, uStack_b0, uStack_ac]

            for i in range(0x200 // 4):
                s_box_val = Crypt_Mhwi.BLOWFISH_SBOX[uVar9 & 0xFFF]
                stack_idx = (s_box_val + saveslot) & 7

                output_val = s_box_val ^ combined_stack[stack_idx] ^ param_1_offset

                struct.pack_into("<I", result, i * 4, output_val)

                # Update uVar9 for next iteration
                byte_sum = ((uVar10 & 0xFF) + ((uVar10 >> 8) & 0xFF) +
                           ((uVar10 >> 16) & 0xFF) + (uVar8 >> 24) + 1)
                uVar9 = (uVar9 + byte_sum) & 0xFF_FF_FF_FF

            return bytes(result)

        @staticmethod
        def generate_salt(key_salt: int) -> bytes:
            salt = bytearray(0x200)

            # First DWORD
            first_offset = 0xC0490023 & 0xFFF
            salt[0:4] = struct.pack("<I", Crypt_Mhwi.BLOWFISH_SBOX[first_offset] ^ 0x4BF0CF23 ^ key_salt)

            # Calculate increment
            iVar4 = ((key_salt >> 24) + ((key_salt >> 16) & 0xFF) +
                    ((key_salt >> 8) & 0xFF) + (key_salt & 0xFF) + 1)
            iVar2 = iVar4

            # Generate remaining 508 bytes
            for i in range(4, 0x200, 4):
                uVar1 = (0xC0490023 + iVar2) & 0xFF_FF_FF_FF
                iVar2 = (iVar2 + iVar4) & 0xFF_FF_FF_FF
                table_offset = uVar1 & 0xFFF
                salt[i:i + 4] = struct.pack("<I", Crypt_Mhwi.BLOWFISH_SBOX[table_offset] ^ 0x4BF0CF23 ^ key_salt)

            return bytes(salt)

        @staticmethod
        def generate_keys(key_salt: int, salt: bytes) -> list[bytes]:
            keys = []

            INITIAL_SEED = 0xC0490023

            # Calculate iVar11 once (same for all iterations)
            iVar11 = ((INITIAL_SEED >> 24) + (INITIAL_SEED & 0xFF) +
                     ((INITIAL_SEED >> 8) & 0xFF) + ((INITIAL_SEED >> 16) & 0xFF))

            # 32 keys
            for i in range(0x20):
                salt_value = struct.unpack("<I", salt[i * 4:(i * 4) + 4])[0]

                # uVar9 = salt[i] ^ key_salt ^ INITIAL_SEED
                uVar9 = salt_value ^ key_salt ^ INITIAL_SEED

                # Calculate the 4 offsets into blowfish_s_box
                offset0 =  INITIAL_SEED & 0xFFF
                offset1 = (INITIAL_SEED + 1 + iVar11) & 0xFFF
                offset2 = (INITIAL_SEED + 2 + iVar11 * 2) & 0xFFF
                offset3 = (INITIAL_SEED + 3 + iVar11 * 3) & 0xFFF

                # Generate 16-byte key
                key = bytearray(16)

                key[0:4]    = struct.pack("<I", Crypt_Mhwi.BLOWFISH_SBOX[offset0] ^ uVar9 ^ 0x701D5D68)
                key[4:8]    = struct.pack("<I", Crypt_Mhwi.BLOWFISH_SBOX[offset1] ^ uVar9 ^ 0x4BF0CF23)
                key[8:12]   = struct.pack("<I", Crypt_Mhwi.BLOWFISH_SBOX[offset2] ^ uVar9 ^ 0x7C8B3AF0)
                key[12:16]  = struct.pack("<I", Crypt_Mhwi.BLOWFISH_SBOX[offset3] ^ uVar9 ^ 0x67308D52)

                keys.append(bytes(key))

            return keys

        @staticmethod
        def generate_key_length(key_salt: int, length: int) -> list[int]:
            key_length = [0] * 32
            SEED = 0xC0490023

            # Calculated from (0x67308D52 ^ 0xC0490023) & 0xFFF
            MAGIC_XOR_MASK = 0xD71

            average_length_int = length >> 5
            average_length_float = float(average_length_int)

            accumulator = (average_length_int + 0xF) & 0xFF_FF_FF_FF

            for i in range(31):
                # 1. Calculate Index 1 (Salt + Iteration XOR Seed)
                idx1 = ((key_salt + i) ^ SEED) & 0xFFF

                # 2. Get value from S-Box/Constants
                lookup_val = Crypt_Mhwi.BLOWFISH_SBOX[idx1]

                # 3. Calculate Index 2 using the mask we derived from EBX
                idx2 = (lookup_val & 0xFFF) ^ MAGIC_XOR_MASK

                # 4. Variation from Float Table
                variation = Crypt_Mhwi.FLOATS[idx2] - 0.5

                # 5. Final length for this round (masked to 16-byte alignment)
                calc_len = (int(variation * average_length_float) + accumulator) & 0xFF_FF_FF_F0
                key_length[i] = calc_len

                # 6. Increment accumulator by the average length for next iteration
                accumulator = (accumulator + average_length_int) & 0xFF_FF_FF_FF

            # Last entry is always the total length
            key_length[31] = length
            return key_length

    @staticmethod
    async def pre(filepath: str) -> bytes:
        s_start = 0x600488
        s_end = 0x6010C0
        async with CC(filepath, in_place=False) as cc:
            await cc.r_stream.seek(s_start)
            section = await cc.r_stream.read(s_end - s_start)

            while await cc.read(stop_off=s_start):
                await cc.w_stream.write(cc.chunk)
            cc.set_ptr(s_end)
            while await cc.read():
                await cc.w_stream.write(cc.chunk)

        return section

    @staticmethod
    async def post(filepath: str, section: bytes) -> None:
        s_start = 0x600488
        async with CC(filepath, in_place=False) as cc:
            while await cc.read(stop_off=s_start):
                await cc.w_stream.write(cc.chunk)
            await cc.w_stream.write(section)
            while await cc.read():
                await cc.w_stream.write(cc.chunk)

    @staticmethod
    async def decrypt_file(filepath: str) -> None:
        if not Crypt_Mhwi.file_check(filepath):
            return

        section = await Crypt_Mhwi.pre(filepath)
        async with Crypt_Mhwi.Mhwi(filepath) as cc:
            await cc.decrypt_region(0x488, 0x2098C0)
            await cc.decrypt_region(0x209F48, 0x2098C0)
            await cc.decrypt_region(0x413A08, 0x2098C0)
        await Crypt_Mhwi.post(filepath, section)

    @staticmethod
    async def encrypt_file(filepath: str) -> None:
        if not Crypt_Mhwi.file_check(filepath):
            return

        section = await Crypt_Mhwi.pre(filepath)
        async with Crypt_Mhwi.Mhwi(filepath) as cc:
            await cc.encrypt_region(0x488, 0x2098C0, 0)
            await cc.encrypt_region(0x209F48, 0x2098C0, 1)
            await cc.encrypt_region(0x413A08, 0x2098C0, 2)
        await Crypt_Mhwi.post(filepath, section)

    @staticmethod
    async def check_dec_ps(folderpath: str) -> None:
        files = await CC.obtain_files(folderpath, Crypt_Mhwi.EXCLUDE)
        files = Crypt_Mhwi.files_check(files)
        for filepath in files:
            async with CC(filepath) as cc:
                off = await cc.find(Crypt_Mhwi.COMMON)
            if off == -1:
                await Crypt_Mhwi.decrypt_file(filepath)

    @staticmethod
    async def check_enc_ps(filepath: str) -> None:
        if not Crypt_Mhwi.file_check(filepath):
            return

        async with CC(filepath) as cc:
            off = await cc.find(Crypt_Mhwi.COMMON)
        if off != -1:
            await Crypt_Mhwi.encrypt_file(filepath)

    @staticmethod
    def file_check(filepath: str) -> bool:
        filename = basename(filepath).lower()
        return not filename.startswith(Crypt_Mhwi.UNSUPPORTED_FORMATS)

    @staticmethod
    def files_check(files: list[str]) -> list[str]:
        valid = []
        for path in files:
            filename = basename(path).lower()
            if not filename.startswith(Crypt_Mhwi.UNSUPPORTED_FORMATS):
                valid.append(path)
        return valid

